INSERT INTO `tp_article` VALUES ('1', '1', null, '欢迎使用星辰CTF', '<p>我们这个星辰CTF平台是由星辰信安工作室团队制作，著作版权归星辰信安工作室所有，因时间短任务重所以前端大部分使用了bugku平台的框架样式，所以为了防止出现版权问题，我们决定前期不收费供各位下载，整体架构构建完成后我们会开始去bugku化，重新设计前端并且后面将会使用Vue重构前端实现前后端分离，让部署更加方便更加安全，同时也希望有兴趣的朋友加入我们，一起开发和优化平台。星辰CTF致力于让广大CTFer都能有自己独立的学习练习以及办赛平台。让团队或单位都能用得起CTF平台！</p>', '45', '64', '42', '5', '1', '0', '2022-03-27 13:45:54', '2022-03-27 09:33:23');
